import React from 'react';

const ProductList = () => {
  return (
    <>
      <h1 className='title'> Productos</h1>
      <div className='products'>
        <Product></Product>
      </div>
    </>
    
  )
}



function Product({ nombre, descripcion, precio }) {
  return (
    <div className="producto">
      <h2>{nombre}</h2>
      <p>{descripcion}</p>
      <p>Precio: ${precio}</p>
      <button>Agregar al carrito</button>
    </div>
  );
}

export  {Product,ProductList};
